	<script>
function hideLightbox() {
    const lightbox = document.getElementById('lightbox-alert');
    lightbox.style.display = 'none';
    localStorage.setItem('lightboxHidden', 'true');
}

document.addEventListener('DOMContentLoaded', () => {
    if (localStorage.getItem('lightboxHidden') === 'true') {
        document.getElementById('lightbox-alert').style.display = 'none';
    }
});
</script>

    <style>
        #clock {
            font-size: 0.6em;
            margin-top: 1px;
        }
    </style>
</head>
<script>
    function updateClock() {
        const now = new Date();
        const hours = now.getHours().toString().padStart(2, '0'); // التوقيت المحلي
        const minutes = now.getMinutes().toString().padStart(2, '0'); // التوقيت المحلي
        const seconds = now.getSeconds().toString().padStart(2, '0'); // التوقيت المحلي

        const clockElement = document.getElementById('clock');
        clockElement.textContent = `${hours}:${minutes}:${seconds}`;
    }
    setInterval(updateClock, 1000);
    updateClock();
</script>
